import React, { useEffect } from "react";
import logo from "./logo.svg";
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap-icons/font/bootstrap-icons.min.css";
import "bootstrap/dist/js/bootstrap.min.js";
import "./App.css";

const CLIENT_ID : string = "e5f9bfa9d40447488e4fc74d2c71d293" ;
const CLIENT_SECRET : string ="be7abe1d68da450a92e9bd87ce439146";

function App() {

  //runs once when app starts
  useEffect(() => {
    //API access token
    var authParameters = {
      method: 'POST',
      headers: {
        'Content-Type' : 'application/x-www-form-urlencoded'
      },

    }
    fetch('https://accounts.spotify.com/api/token',)
  }, [])

  return (
    <div className="App">
      <nav className="navbar navbar-expand-lg mx-5 navbar-dark bg-dark">
        <div className="container-fluid">
          <a className="navbar-brand" href="#">
            Spotify Analytics <i className="bi bi-bar-chart-line-fill text-success"></i>
          </a>
          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarNavAltMarkup"
            aria-controls="navbarNavAltMarkup"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarNavAltMarkup">
            <div className="navbar-nav">
              <a className="nav-link" aria-current="page" href="#">
                Top Tracks
              </a>
              <a className="nav-link" href="#">
                Top Artists
              </a>
              <a className="nav-link" href="#">
                Top Genres
              </a>
            </div>
            <div className="d-flex">

                <button className="btn btn-success ml-auto">
                    Sign in
                </button>
            </div>
          </div>

        </div>
      </nav>
    </div>
  );
}

export default App;
